  false,\n\t\"url\": null,\n\t\"notes\": \"All open tree debris removal requests made
  to 311 and all requests completed since January 1, 2011. Large piles of branches
  or bushes may be picked up by the Department of Streets and Sanitation.rn311 sometimes
  creates duplicate requests for tree debris removal.  When there is an open tree
  debris request, a duplicate request is created when the exact same address and the
  exact same service request type are used. Streets and Sanitation responds to the
  initial request opened and closes the duplicates. A forestry \"Clam\" is the name
  of the vehicle the Forestry Bureau deploys to collect tree debris.rnData Owner:
  Streets and Sanitation (http://www.cityofchicago.org/content/city/en/depts/streets.html).rnTime
  Period: January 1, 2011 to present.rnFrequency: Data is updated daily.rnRelated
  Applications: 311 Service Request Status Inquiry (https://servicerequest.cityofchicago.org/web_intake_chic/Controller?op=createsrquery2)
  and rn                                    Request Tree Debris Removal (https://servicerequest.cityofchicago.org/web_intake_chic/Controller?op=locform&invSRType=SEL&invSRDesc=Tree%20Debris&locreq=Y).\",\n\t\"license_title\":
